cl-tree-equal is an autoloaded compiled Lisp function in `cl-seq.el'.<br/><br/>(cl-tree-equal TREE1 TREE2 [KEYWORD VALUE]...)<br/><br/>Return t if trees TREE1 and TREE2 have `eql' leaves.<br/>Atoms are compared by `eql'; cons cells are compared recursively.<br/><br/>Keywords supported:  :test :test-not :key
